{
  "translationLines": [
    {
      "lineNumber": 64321,
      "originalJapaneseLine": "さっさと潜り込んでしまった。",
      "translatedEnglishLine": "Quickly slipped inside."
    },
    {
      "lineNumber": 64322,
      "originalJapaneseLine": "「お休みー、ランス」",
      "translatedEnglishLine": "\"Goodnight, Rance.\""
    },
    {
      "lineNumber": 64323,
      "originalJapaneseLine": "「む……ぅ……ん、がぁぁぁぁーー……",
      "translatedEnglishLine": "\"Mmm... ugh... gaaahhh—..."
    },
    {
      "lineNumber": 64324,
      "originalJapaneseLine": "　すぴょぴょぴょぴょ…………」",
      "translatedEnglishLine": "  *snoring sounds*..."
    },
    {
      "lineNumber": 64325,
      "originalJapaneseLine": "「はぁ……」",
      "translatedEnglishLine": "\"Sigh...\""
    },
    {
      "lineNumber": 64326,
      "originalJapaneseLine": "「………………あ、あはは……」",
      "translatedEnglishLine": "\".........Ah, haha...\""
    },
    {
      "lineNumber": 64327,
      "originalJapaneseLine": "その場に取り残された形の二人が、",
      "translatedEnglishLine": "The two left behind in that spot,"
    },
    {
      "lineNumber": 64328,
      "originalJapaneseLine": "遠慮がちに苦笑を交わした。",
      "translatedEnglishLine": "exchanged hesitant wry smiles."
    },
    {
      "lineNumber": 64329,
      "originalJapaneseLine": "戦時下には相応しくない、",
      "translatedEnglishLine": "An afternoon breeze, unsuited for wartime,"
    },
    {
      "lineNumber": 64330,
      "originalJapaneseLine": "昼下がりの風が中庭に吹き抜けた。",
      "translatedEnglishLine": "blew through the courtyard."
    },
    {
      "lineNumber": 64331,
      "originalJapaneseLine": "ワシントン花畑――",
      "translatedEnglishLine": "Washington Flower Field—"
    },
    {
      "lineNumber": 64332,
      "originalJapaneseLine": "「………………」",
      "translatedEnglishLine": "\"..............\""
    },
    {
      "lineNumber": 64333,
      "originalJapaneseLine": "音もなく、かなみが花と花の間を疾走する。",
      "translatedEnglishLine": "Without a sound, Kanami dashed between the flowers."
    },
    {
      "lineNumber": 64334,
      "originalJapaneseLine": "鳴り響く鈴のような花々をすり抜け、",
      "translatedEnglishLine": "Slipping through the ringing, bell-like flowers,"
    },
    {
      "lineNumber": 64335,
      "originalJapaneseLine": "一路、工場を目指して足を運んでいく。",
      "translatedEnglishLine": "she moved straight toward the factory."
    },
    {
      "lineNumber": 64336,
      "originalJapaneseLine": "かなみはランスの命を受け、",
      "translatedEnglishLine": "Kanami, under Rance’s orders,"
    },
    {
      "lineNumber": 64337,
      "originalJapaneseLine": "パイアールの城であるワシントン花畑まで、",
      "translatedEnglishLine": "had come once again to Washington Flower Field, the Piaarl castle."
    },
    {
      "lineNumber": 64338,
      "originalJapaneseLine": "再び訪れていた。",
      "translatedEnglishLine": "She was visiting again."
    },
    {
      "lineNumber": 64339,
      "originalJapaneseLine": "（気配は、なしか……）",
      "translatedEnglishLine": "(No sign of presence...?)"
    },
    {
      "lineNumber": 64340,
      "originalJapaneseLine": "工場の周辺に、警戒の痕跡もない。",
      "translatedEnglishLine": "There were no traces of alertness around the factory."
    },
    {
      "lineNumber": 64341,
      "originalJapaneseLine": "人間や原始的な道具ではなく、パイアールの機械が",
      "translatedEnglishLine": "Even if the opponent was Piaarl machinery,"
    },
    {
      "lineNumber": 64342,
      "originalJapaneseLine": "相手だとしても、気配がなさ過ぎた。",
      "translatedEnglishLine": "not humans or primitive tools, there was too little presence detected."
    },
    {
      "lineNumber": 64343,
      "originalJapaneseLine": "やがて、花畑の中心部、工場が見えてきた。",
      "translatedEnglishLine": "Eventually, the factory came into view at the center of the flower field."
    },
    {
      "lineNumber": 64344,
      "originalJapaneseLine": "（無警戒？　まさか…………）",
      "translatedEnglishLine": "(Unalert? No way...?)"
    },
    {
      "lineNumber": 64345,
      "originalJapaneseLine": "「なんの、気配もない…………罠……？」",
      "translatedEnglishLine": "\"There's no sign of anything... a trap...?\""
    },
    {
      "lineNumber": 64346,
      "originalJapaneseLine": "「ううん、何もなし、で正解よ、隊長」",
      "translatedEnglishLine": "\"No, nothing's here, that’s the right answer, Captain.\""
    },
    {
      "lineNumber": 64347,
      "originalJapaneseLine": "「ぴゃあああぁぁ！？」",
      "translatedEnglishLine": "\"Pyaaah!?!\""
    },
    {
      "lineNumber": 64348,
      "originalJapaneseLine": "まったく気配を感じなかった背後から、",
      "translatedEnglishLine": "From behind, where no presence had been felt at all,"
    },
    {
      "lineNumber": 64349,
      "originalJapaneseLine": "フレイア・イズンがぽんと肩を叩いた。",
      "translatedEnglishLine": "Freya Isun lightly tapped her on the shoulder."
    },
    {
      "lineNumber": 64350,
      "originalJapaneseLine": "「フ、フレイアさん！？」",
      "translatedEnglishLine": "\"F-Freya-san!?\""
    },
    {
      "lineNumber": 64351,
      "originalJapaneseLine": "「どうも、拠点を移したような匂いがするわ。",
      "translatedEnglishLine": "\"It seems they moved their base."
    },
    {
      "lineNumber": 64352,
      "originalJapaneseLine": "　内部は警戒装置でぎっしりだけど」",
      "translatedEnglishLine": "The inside is packed with security devices though.\""
    },
    {
      "lineNumber": 64353,
      "originalJapaneseLine": "（う、うう……き、気づけなかった……）",
      "translatedEnglishLine": "(Ugh, I couldn’t... notice it...)"
    },
    {
      "lineNumber": 64354,
      "originalJapaneseLine": "「で、どうするの？　中まで入ってみる？」",
      "translatedEnglishLine": "\"So, what will you do? Do you want to go inside?\""
    },
    {
      "lineNumber": 64355,
      "originalJapaneseLine": "「そ……そう、ですね……」",
      "translatedEnglishLine": "\"Y-Yes, that’s right...\""
    },
    {
      "lineNumber": 64356,
      "originalJapaneseLine": "気を取り直して、念のため用心をしながら、",
      "translatedEnglishLine": "Pulling herself together and being cautious just in case,"
    },
    {
      "lineNumber": 64357,
      "originalJapaneseLine": "工場の周囲をぐるりと回る。",
      "translatedEnglishLine": "she circled around the factory."
    },
    {
      "lineNumber": 64358,
      "originalJapaneseLine": "「あ……」",
      "translatedEnglishLine": "\"Ah...\""
    },
    {
      "lineNumber": 64359,
      "originalJapaneseLine": "「あら」",
      "translatedEnglishLine": "\"Oh?\""
    },
    {
      "lineNumber": 64360,
      "originalJapaneseLine": "『しばらく留守にします。",
      "translatedEnglishLine": "\"We will be absent for a while."
    },
    {
      "lineNumber": 64361,
      "originalJapaneseLine": "　魔物界の本工場に戻っています』",
      "translatedEnglishLine": "We have returned to the main factory in the monster world.\""
    },
    {
      "lineNumber": 64362,
      "originalJapaneseLine": "工場の正面入口は、",
      "translatedEnglishLine": "On the main entrance of the factory,"
    },
    {
      "lineNumber": 64363,
      "originalJapaneseLine": "そう簡素に書かれた紙が貼り付けられていた。",
      "translatedEnglishLine": "a simple piece of paper with those words was posted."
    },
    {
      "lineNumber": 64364,
      "originalJapaneseLine": "「は、張り紙……？」",
      "translatedEnglishLine": "\"A... notice...?\""
    },
    {
      "lineNumber": 64365,
      "originalJapaneseLine": "「意外と律儀ね」",
      "translatedEnglishLine": "\"Surprisingly conscientious.\""
    },
    {
      "lineNumber": 64366,
      "originalJapaneseLine": "「一応……内部も確認しましょう。",
      "translatedEnglishLine": "\"Just to be sure... let's check inside as well."
    },
    {
      "lineNumber": 64367,
      "originalJapaneseLine": "　何か変化があるかも知れませんし……」",
      "translatedEnglishLine": "There might be some changes...\""
    },
    {
      "lineNumber": 64368,
      "originalJapaneseLine": "「はいはい、了解」",
      "translatedEnglishLine": "\"Alright, got it.\""
    },
    {
      "lineNumber": 64369,
      "originalJapaneseLine": "ふたつの影は、音もなく内部へと侵入していった。",
      "translatedEnglishLine": "The two shadows silently infiltrated inside."
    },
    {
      "lineNumber": 64370,
      "originalJapaneseLine": "自由都市、Mランド――",
      "translatedEnglishLine": "Free City, M Land—"
    }
  ]
}

